import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import axiosInstance from "../../baseurl";

function ViewTrainerPrograms() {
  const { id } = useParams;
  const [pgmreq, setpgmreq] = useState([]);
  const [approvedpg, setapprovedpgm] = useState([]);

  useEffect(() => {
    console.log(id);
    axiosInstance
      .post(`/viewPgmByTrainerId/${id}`)
      .then((res) => {
        console.log(res, "approved programs");
      })
      .catch((err) => {
        console.log(err);
      });

    axiosInstance
        .post(`/viewPgmRequests/${id}`)
        .then((res) => {
          console.log(res, 'program requests');
        })
        .catch((err) => {
          console.log(err);
      });
  });

  const apprfn = () => {};
  return (
    <div>
      prgms to be approved
      approved programs
    </div>
  );
}

export default ViewTrainerPrograms;
